macrobase:
  baseQuery: SELECT * FROM mapmatch_history H, sf_datasets D WHERE H.dataset_id = D.id AND userid IS NOT NULL LIMIT 100000;
  targetHighMetrics: [data_count_minutes]
  dataTransform: IDENTITY
  targetLowMetrics: []
  targetAttributes: [userid]
  auxiliaryAttributes: [battery_delay_from_drive_end_seconds]
  outlierDetectorType: MCD
  dataLoaderType: SQL_LOADER
